Description:
By: JenElaine  
allrecipes.com
&quot;Quick and easy asparagus that is sauteed, and topped off with Parmesan cheese.&quot;

RecipeInstructions:
c("1. Make 3 pans of cornbread by mixing 3 packets of mix, 3 eggs, and 1 cup of milk in large bowl and pouring into 3 pans. Cook in oven according to the directions on the box for your choice of pan/pans.", "2. In large roasting pan combine cakes of cornbread, celery, onion, poultry seasoning(1/2 of a 0.55 ounce container seems to be perfect), cream of chicken, and turkey broth. (If you are using chicken broth I would start off with 1 can and add more as you feel the stuffing getting drier than you prefer.).", 
"3.Add bread 4 slices at a time to desired thickness.", "4.Add Salt and Pepper to taste.", "Cook at 400 degrees for 15 min or until the top is golden. Cover and decrease heat to 350 for another 30 minute or until vegetables are soft.", "**** Make sure the broth is as warm as possible when you add it to the mixture and begin mashing it with your hands. This will deliver a more realistic idea of the consistancy (moist vs. firm) you will have after cooking. This occurs because the broth contains gelatins that thicken according to temperature. The more the temperature drops during mixing, the more firm your stuffing will appear and after cooking it will be that much drier."
)

c("Using a glass (drinking cup), or circular cookie cutter that is just smaller than the crust line, cut out a circle inside the slice of bread.", "Heat skillet on the stove over medium-low heat.", "Coat bottom of skillet with butter or non-stick spray so the egg and bread will not stick.", "Place bread (\"nest\"), with center hole removed, into the skillet.", "Crack the egg into the middle of the hole (you may season the egg with your favorite seasonings, if you like, or leave it plain).", "While \"Egg in a Nest\" is cooking, you can toast the circle cut-out of bread, for a small side of toast. Add butter (and honey, or any other topping) to the circle piece of toast as soon as it comes out of the toaster.", 
"Keeping a close eye on the skillet, remove \"egg in a nest\" when egg is cooked to your liking (sunny-side up), OR -- Cover skillet with a lid for 2-4 minutes for \"over-easy, over-medium, or over-hard\" eggs. Check often to make sure it is cooked to your liking. Every stove-top cooks differently, so use the time frame given as an estimate.", "Remove with spatula.", "Plate, and serve with your little piece of toast!", "**You can also top this with shredded cheese, if you want a more savory meal, or drizzle on some honey for something sweeter. Use forks or fingers! :)."
)

c("Heat 4 cups vegetable oil in a deep-fryer or large saucepan to 375 degrees F (190 degrees C).", "Beat the egg in a mixing bowl. Add the chicken cubes; sprinkle with salt, 1 teaspoon sugar, and white pepper; mix well. Mix in 1 cup of cornstarch a little bit at a time until the chicken cubes are well coated.", "In batches, carefully drop the chicken cubes into the hot oil one by one, cooking until they turns golden brown and begin to float, about 3 minutes. Remove the chicken and allow to cool as you fry the next batch. Once all of the chicken has been fried, refry the chicken, starting with the batch that was cooked first. Cook until the chicken turns deep golden brown, about 2 minutes more. Drain on a paper towel-lined plate.", 
"Heat 2 tablespoons vegetable oil in a wok or large skillet over high heat. Stir in the green onion, garlic, whole chiles, and orange zest. Cook and stir a minute or two until the garlic has turned golden and the chiles brighten. Add 1/2 cup sugar, the ginger, chicken broth, vinegar, soy sauce, sesame oil, and peanut oil; bring to a boil and cook for 3 minutes.", "Dissolve 2 teaspoons of cornstarch into the water, and stir into the boiling sauce. Return to a boil and cook until the sauce thickens and is no longer cloudy from the cornstarch, about 1 minute. Stir the chicken into the boiling sauce. Reduce heat to low and cook for a few minutes until the chicken absorbs some of the sauce."
)

c("In a 1-gallon zip-lock plastic bag, combine lime juice, tequila, oil, cumin, oregano, 6 tablespoons hot sauce, and garlic. Add chicken and onions, seal, and chill at least 15 minutes or up to 2 hours, turning occasionally.", "Combine tomatoes and 1/4 teaspoon to 1 1/2 teaspoons hot sauce; set aside.", "Oil a barbecue grill over a solid bed of hot coals or gas grill on high heat (you can hold your hand at grill level only 2 to 3 seconds). Lift onions from marinade and place on grill. Close lid on gas grill. Cook onions for 3 minutes, turn, cook a couple more minutes, then turn over and baste with marinade.", 
"Lift chicken from marinade and place on grill; close gas grill. Turn and baste chicken and onions occasionally until onions are soft and browned and meat is no longer pink in thickest part (cut to test), about 8 minutes. Transfer chicken and onions to a board and keep warm.", "Heat tortillas on grill, turning once, until softened and lightly speckled brown, 30 to 60 seconds.", "Slice chicken crosswise. Place portions of chicken, onions, and beans in tortillas. Top with tomatoes, sour cream, and a squeeze of lime. Fold up bottom of tortillas, then fold in sides."
)

c("Pour rums into container.", "Add sugar and vanilla beans.", "Stir until sugar is  dissolved.", "Cut the citrus fruits in half.", "Squeeze juice into the rum; then toss  in the shells.", "Peel and slice the bananas.", "Peel and slice the pineapple. Add  banana and pineapple to rum.", "Cover container and let stand in a cool place for  two to three days.", "Stir several times during each day.", "On the day of the  celebration, remove pulp, vanilla beans and citrus rinds.", "Pour rum mixture over  ice in a large punch bowl and let chill fo r a few hours.", 
"Just before serving add chilled white wine. Decorate bowl with sliced citrus fruits and float a few  slices in the punch.", "If you don't have a large punch bowl, add ice to the  container; let chill.", "Add wine just before serving - float citrus slices in the  punch.", "----------- Notes: I recommend a new 15 gallon plus plastic garbage can with cover.", "Wash and rinse well before using.", "A new canoe paddle makes an excellent stirring device. (The bonus is they can be saved and used for this again, or can be used for their original purpose.)  DO NOT USE a metal container (unless it is stainless steel). Due to the interaction of the rum and citric acids on metal - it would ruin the punch with a metallic flavour and the dissolved metals could poison your guests."
)

c("Biscuits-preheat the oven to 425°; line 2 large baking sheets with parchment paper.", "Combine the flour, baking powder, salt, and cayenne in a big bowl.", "Add in the butter and, with your fingertips or a pastry blender, blend it into the flour mixture until the mixture resembles coarse meal.", "Stir in the cheese.", "Add the buttermilk and mustard; mix well.", "Transfer the mixture to a lightly floured surface and gently knead about 3 times, until is just forms a dough.", "Roll out to a thickness of 1/2 inch.", 
"Cut out biscuits using a 1 1/2 inch round biscuit cutter.", "Gather the scraps and reroll.", "Cut out additional biscuits.", "Transfer the biscuits to the prepared baking sheets; bake until puffed and light golden on the bottom, about 12 minutes; cool on a rack.", "Assemble-split each biscuit in half.", "Place a scant teaspoon of chutney on the bottom half of the biscuit, followed by a piece of ham, the top with the other half of the biscuit.", "Transfer to a serving platter and serve at room temperature."
)

c("In a small bowl, combine lime juice, sugar, fish sauce, and chiles. Set dressing aside.", "In a large serving bowl, combine mint, basil, dill, parsley, cilantro, onion, celery, and cashews. Set aside.", "In a 4-qt. pot about 10 inches in diameter, heat vegetable oil until it registers 360° on a candy thermometer.", "While oil is heating, slice calamari tubes into 1/2-3/4\" rings.", "Put in a small bowl with tentacles. Set aside.", "In another small bowl, combine all-purpose flour, rice flour, 1 teaspoons salt, and the cayenne.", 
"Drop the calamari pieces into the flour mixture, turning to coat well.", "Working in 3 batches, fry squid 3 to 5 minutes per batch, or until pieces are light brown.", "Using a slotted spoon, transfer fried calamari to a large plate lined with several folded paper towels and sprinkle lightly with salt to taste.", "Allow oil temperature to return to 360° between batches.", "Add the warm calamari to the herb-cashew mixture and pour half of the dressing over it.", "Toss gently just until coated.", "Serve salad immediately, with remaining dressing on the side."
)

c("Put all the ingredients into your bread machine and select the Dough Program.  Add the raisins before the end of the last kneading, when your machine beeps.  (If it doesn't offer you this option, add them when you roll out the dough).", "Place the prepared dough onto a lightly floured surface and let it rest for 5 minutes.", "Using a lightly floured rolling pin, roll the dough into a 1/4 inch thick rectangle.", "Mix up 1/3 cup soft brown sugar, 2 tsp cinnamon and 2 tbs soft butter into a paste.  Spread this onto the dough.", 
"Roll the dough up lengthwise, like a jelly-roll / Swiss roll.", "Slice into 1 inch thick rounds.  Place these into a lightly greased deep sided baking tray (a roasting tray is good)  Cover with a clean cloth and place into a warm, draft-free spot to rise for an hour.", "Bake at 180 deg C for 15 to 20 minutes.", "Remove and while cooling drizzle with a paste of Icing sugar and water.  No quantities for this - just use icing sugar and add teaspoons of hot water at a time.  Mix until smooth and not too runny."
)

c("Before going to bed, mix together the sponge in a glass bowl. Add enough water for a thick waffle dough.  Cover bowl with plastic wrap and allow to stand in a warm place over night.", "In the morning, add the buttermilk powder, ground flax seed and sea salt to the sponge and stir well.", "Beat the egg yolks with coconut oil, vanilla and honey.  Set aside.", "Beat the egg whites until stiff.  Fold the beaten egg yolk mixture into the sponge and then carefully fold in egg whites.  Allow the waffle batter to rest for 15 minutes in a warm place.", 
"Mix the baking soda with 1 tablespoon water and add ton the mixture stirring gently.", "Spoon batter onto preheated waffle iron and bake until crisp and brown.  Please note that gluten free products often require a little longer to cook completely.", "Leftovers can be bagged and frozen for another day.  To reheat, place frozen waffle in toaster oven and toast.", "Sourdough baking isn't an exact science.  If the batter is to thin add additional flours.  If the batter is to thick add additional water."
)

c("Heat oil; add onion, leek, bay leaf, thyme, and parsley.", "Cook on a low setting for 10 to 12 minutes until soft and translucent.", "Bring up the heat to medium or medium-high.", "Add the carrots, celery, and garlic.", "Stir occasionally until carrots are done or mostly done, 10 minutes or so.  When vegetables are cooked, stir in the nutritional yeast flakes; they will get creamy with the veggies and oil.", "Add 8 cups water (2 quarts), and salt.", "Cover and bring to a boil.", "While water is coming up to a boil (it will do so quickly!) put the dumplings together.", 
"DUMPLINGS:", "Mix wet in one bowl, dry in another.  Pour wet into dry and combine until a heavy dough forms.", "Knead on lightly floured surface for 1 minute.  If dough is sticky add a bit more flour until it is fairly dry.", "Let dough rest 5 minutes.", "Roll out to 1/8\" thickness and cut into 2 x 1\" strips (or whatever size you find easy to work with though they'll take a lot longer to cook if they are bigger).", "Drop into boiling broth; cover and simmer 20 to 35 minutes.", "The non-egg version needed to cook longer than my original version, but I'm also high altitude. Taste for doneness. They'll seem mealy if they're not done yet. When done they are sort of like thick noodles or a biscuit or something. Yummy and hearty. If in doubt, let them cook another 5 minutes and taste again."
)

c("To make the pastry:", "Make a well in the flour. Cut the butter into large chunks, 1 tablespoon each, and add. Add the salt. With the fingertips, flatten the butter in the flour until the mixture is mealy and the butter is in pieces the size of peas. add the yoghurt. Mix with fingertips. Frasier twice. Flatten into a 1/2 inch by 4 inch disc. Refrigerate.", "To make the filling:", "Heat the butter in a skillet. Add the zucchini and stir. Sprinkle with the sugar and salt. Add the caraway seeds, lemon juice and rind. Cook until the zucchini loses its bright green color and the juices have thickened. Cool completely.", 
"To prepare the custard:", "Cream the butter well. Beat in the sugar, juice of two lemons, 2eggs, 2 egg yolks a pinch of salt and the rum. Mix well. Fold in the flour and lemon rind.", "To bake the pie:", "Preheat the oven to 375 degrees. roll out the pastry to fit a 9 inch quiche pan. Line the bottom of the shell with the zucchini and its juices. Bake 20 minutes on bottom rack of oven.", "Pour the custard over the zucchini and raise pie to the top rack of the oven. Bake another 20 to 25 minutes or until the custard is set. Sprinkle the superfine sugar on top and broil for 1 minute. Serve lukewarm or cold."
)

c("To prepare sauce, combine first 4 ingredients; set aside.", "To prepare filling, heat a large non-stick skillet coated with cooking spray over medium-high heat. Add mushrooms; cook 3 minutes or until moisture evaporates, stirring frequently. Add cabbage; cook 3 minutes or until softened, stirring frequently. Stir in 2 tablespoons green onions and next 6 ingredients (2 tablespoons green onions through garlic); simmer 2 minutes. Remove from heat; set aside.", "Working with 1 wrapper at a time, spoon 2 teaspoons mushroom mixture into center of wrapper. Fold in half. Fold top edge of wrapper at 1/2-inch intervals to form pleats, pressing against bottom edge to seal. Place dumplings, pleated sides down, on a large baking sheet dusted with flour; cover loosely with towel to prevent drying.", 
"Line each tier of a 2-tiered (10-inch) bamboo steamer with 3 lettuce leaves. Arrange 6 dumplings, 1-inch apart, in each steamer basket. Stack tiers; cover with steamer lid. Add water to a large skillet to a depth of 1 inch; bring to a boil. Place steamer in pan, and steam dumplings 5 minutes. Remove dumplings from steamer. Repeat procedure with remaining lettuce and dumplings.", "Heat 1 1/2 teaspoons oil in a large non-stick skillet over medium-high heat. Add 12 dumplings; cook 1 1/2 minutes on each side or until browned. Repeat procedure 3 times with remaining oil and dumplings. Serve with sauce."
)

c("Prepare canner, jars and lids.", "Cut the peel of a lemon into quarters and remove it. The lemon should be large enough to yield 1/4 cup. Remove the rind and cut the peel into thin slices.  Reserve the juice of the lemon.", "In a large, deep stainless steel saucepan, combine lemon peel and water to cover.  Bring to a boil over medium-high heat and boil for about 5 minutes, until peel is softened.  Drain and discard liquid.", "Add strawberries and lemon juice to peel and mix well.", "Whisk in pectin until dissolved.", 
"Bring to a boil over high heat, stirring constantly.", "Add sugar all at once and return to a full rolling boil, stirring constantly.", "Boil hard, stirring constantly, for 1 minute.  Remove from heat and skim off foam.", "Ladle hot marmalade into hot jars, leaving 1/4 inch (0.5 cm) headspace.  Remove air bubbles and adjust headspace, if necessary, by adding hot marmalade.", "Wipe rim.  Center lid on jar.  Screw bad down until resistance is met, then increase to fingertip-tight.", "Place jars in canner, ensuring they are completely covered with water.  Bring to a boil and process for 10 minutes."
)

c("Preheat oven to 350 f.", "Butter or coat with cooking spray a 9x13 inch backing pan.", "In a medium-size bowl, stir flour with baking powder, baking soda, cinnamon, ginger, nutmeg, allspice and salt.", "set aside.", "In a large bowl,using a electric mixer, beat butter with brown sugar until creamy.", "beat in juice, eggs, vanilla and pumpkin puree until blended.", "Gradually beat in flour mixture, mixing just until smooth, about 2 min.", "Stir in nuts, if using, and candied ginger.", "Scrape batter into pan and smooth surface.", 
"Bake in center of 350 f.", "oven until sides of cake pull away from pan and a cake tester inserted in center of cake comes out clean (30-35 min).", "Meanwhile, for glaze, stir icing sugar with peel in a small bowl.", "Gradually stir in juice until its a spreading consistancy.", "Turn out cake, turn top side up on cooling rack.", "Spoon glaze down center of cake and spread.", "When glaze has set cut into squares or bars and serve.", "Cake will keep in refigerator for at least 1 week and freezes well."
)

c("Bring the beer, onions and brown sugar to a boil. Place the Brats in the liquid and turn down to lowest heat, so they just simmer. Now get your grill fired up and when it's ready take your brats out of the beer and grill them. Since they are pretty well done, they need very little time on the grill. Turn the heat up to high under the beer. Dump in all or part of your drained sauerkraut. Let it cook on high until the brats come in from the grill (if you are not a lover of sauerkraut leave this off).", 
"Condiments: Mustard, catsup, sweet pickle relish, raw onions as well as the sauerkraut onion mixture from the pot your brats where inches In Milwaukee we could buy a Brat Bun which is firmer more like French bread. But hot dog or hoagie buns will work too. :-).", "When they cook them on the parking lots, they put the grilled brats right back into the beer and hold them there until people buy them. They have large pans sitting at the back of the grills. Since it's a promotion, they sell for $1.00. Yummmm!"
)

c("Make the crust:.", "In a bowl stir together the cookie crumbs and the butter until the mixture is combined well and pat the mixture onto the bottom and 1/2 inch up the side of a 9 1/2-inch spring form pan. Chill the crust for 30 minutes.", "Make the filling:.", "Preheat the oven to 325°F In a bowl with an electric mixer beat the cream cheese until it is light and fluffy, add the sugar gradually, beating, and beat the mixture until it is combined well. Beat in the flour, add the eggs, 1 at a time, beating well after each addition, and beat in the sour cream, the zests, the salt, and the vanilla, beating the filling until it is combined well.", 
"Pour the filling into the crust and bake the cheesecake in a foil-lined shallow baking pan in the middle of the oven for 1 hour and 10 minutes. (The cheesecake will not be completely set; it will set as it cools.) Turn the oven off and let the cheesecake stand in the oven with the oven door propped open about 6 inches until it is cooled completely and remove the side of the pan.", "Arrange the raspberries on top of the cheesecake in a star shape and arrange the blueberries around the star to cover the top of the cheesecake."
)

c("grease and lightly flour 2  8\" round cake pans -- or 1 9x13\" pan.", "In bowl, mix flour, soda and salt.", "In large mixing bowl, beat Crisco with mix about 30 seconds add sugar and vanilla till well combined.", "Add egg yolks 1 at a time, beating well after each addition, alternating with flour mixture and buttermilk to Crisco, beat on low speed just till combined.", "Wash beaters well. In a medium bowl, beat egg whites on medium till soft peaks form.gently fold whites with beaten mixture -- spread into prepared pans.", 
"Bake at 350° for 30-35 minutes for 8\" cake rounds or 35-40 for 13 x 9 pan or until toothpick inserted near the center comes out clean.", "Cool on rack in pan for 10 minutes.remove from pans to cool completely.", "ICING: (frost and fill layers, cover and store in refrigerator up to 3 days. Let stand at room temperature 30 minutes before serving.", "To prepare icing -- mix 1 cup milk with 1/4 cup flour.cook and stir till bubbly -- reduce heat -- cook and stir for 2 minutes. Transfer mixture to a small bowl, cover surface with plastic wrap, chill 2 hours. In large mixing bowl, beat 1 cup butter, 1 cup granulated sugar and 1 tsp vanilla till fluffy and sugar is almost dissolved -- add cooled cooked mixture, 1/4 amount at a time -- beat till smooth."
)

c("Preheat oven to 350°F.", "Use a 10\"x1-1/2\" round tart pan(with or w/out removable bottom).", "Prick pastry shell on bottom with fork.", "Meanwhile, heat butter, margarine or oil in a large nonstick skillet over medium high heat.", "Add shallots, and cook stirring, until translucent but not brown, about 1 minute.", "Add mushrooms and season with salt and pepper.", "Cook, stirring frequently, until mushrooms first release their liquid and then liquid evaporates and mushrooms are golden brown, 8-10 minutes.", 
"Place tart pan on a baking sheet to catch any run-off there might be(especially if you are using a pan with a removable bottom.).", "Sprinkle half the cheeses evenly over the bottom crust.", "Spread mushrooms over the cheeses and then top with remaining cheeses.", "In a medium bowl, whisk together milk, cream, and eggs.", "Season with nutmeg, salt, and pepper.", "Pour over cheeses.", "Sprinkle with chopped parsley.", "Transfer to oven, and bake until just set in the center, 30-35 minutes.", "Cool on wire rack for about 10 minutes before slicing."
)

Description:
A recipe that is simply done, and cobines different ingredients to an excellent result.

Found in &quot;French Cooking in the New World&quot;

I use Moselle Valley Reisling; likewise its important that you use pure maple syrup, as corn syrup doesn't get it done!

RecipeInstructions:
c("Preheat the oven to 140C/120C Fan/Gas 1. Line a baking tray with baking paper. Mix the cornflour with the vinegar and vanilla. Set aside.", "Mix together the icing and caster sugars and set aside. Put the egg whites in a large, clean, dry bowl and whisk at a slow speed until foamy - this is easier with an electric mixer. Increase the speed and whisk until it forms stiff peaks.", "Add the sugars a spoonful at a time, whisking until stiff again after each addition. When all the sugar is added, whisk until the meringue forms stiff, glossy peaks. Add the cornflour mixture and whisk for a few seconds. Fold in the dessicated coconut.", 
"Put on the baking paper and shape with the back of a large spoon to make a 22cm round with raised edges. Bake for 1 hour 15 minutes, or until the meringue is crisp on the outside and mallowy inside. It's ready when the paper can be peeled away easily. Turn off the oven and leave the meringue inside for another 30 minutes.", "Put the meringue case on a large plate. Whip the cream until it just holds its shape. Fold in some of the mango and pile into the meringue case. Decorate with the rest of the mango and chopped mint."
)

c("Preheat oven to 325ºF. Season short ribs with salt and pepper on all sides; set aside. In a large Dutch oven over medium-high heat, add oil and butter. When hot, place short ribs until caramelized on all sides. Transfer on a plate and set aside.", "In the same pot, add onion, reduce heat to medium and sauté until soft, about 5 minutes. Add shiitake mushrooms and cook for 3 minutes, stirring constantly to prevent from burning. Add garlic and sauté for 1 minute. Stir in flour to coat ingredients. Pour in beef broth and cooking sherry; scrap any bits at the bottom. Stir in tomato paste, rosemary, balsamic vinegar and cayenne.", 
"Bring it back to a simmer on medium-high. Place short ribs back and pour more broth over enough to cover meat. Cover and transfer to the preheated oven. Braise for 2 hours or until ribs are fork-tender.", "Remove from heat and transfer short ribs on a plate while working on sauce.", "Put heat on medium and skim off fat on the surface. When simmering, pour in cornstarch mixture and stir until sauce thickens, less than a minute. Taste and adjust seasoning if necessary. Place short ribs over mashed potato, ladle sauce over and sprinkle fresh parsley on top. Makes 4 servings."
)

c("Cut the chard crosswise into 1-2 inch slices. In a large skillet heat the oil over medium-heat. Add the onion and stir occasionally for about 10 minutes, until they become golden and caramelized. Add the garlic and red pepper and stir for 1 minute, until fragrant. Add the broth, greens and a pinch of salt. Cover reduce heat to low and cook until the greens are almost tender, (spinach will just take about 2 minutes, chard about 5, and heartier greens like collards, about 7-8) stirring occasionally. Remove lid and turn heat back to medium, stirring, until the mixture is nearly dry and adjust salt to taste.", 
"Meanwhile, heat a flat skillet over medium-high heat and warm the tortillas for a minute or so per side. Fill the warm tortillas with veggies and top with crumbled queso and salsa.", "**You can use your favorite salsa, or make a quick, smokey chipotle salsa. Place 1-2 tomatoes, cut in half, half side down under the broiler with a few peeled cloves of garlic until slightly charred - a few minutes. Blend, tomatoes, garlic and 2-3 chipotles in adobo sauce (you’ll find these in a can) with a splash of olive oil and salt and pepper to taste."
)

c("Trim all fat from meat and if not pounded flat by your butcher, take a metal or wooden cooking mallet and pound the steak until the tissues are broken down and it is pretty thin.", "Cut steak into long thin strips.", "Season flour with salt and pepper.", "Arrange an assembly line for preparation for ease of rolling.", "On each piece of steak, place a dab of mustard and rub it along the steak.", "Add a piece of bacon.", "Add a piece of pickle slice.", "Sprinkle a dab of marjoram.", "From one end of the steak, start rolling the steak, bacon, pickle until completely rolled and secure with toothpicks or string.", 
"Continue until all steak is rolled.", "Dredge rolls of steak into flour until coated.", "Heat oil in deep fryer pan.", "Brown steak until browned.", "Transfer to casserole dish.", "Continue browning and transferring into casserole dish until done.", "Preheat oven to 350°F.", "Stir and scrape up any browned bits left in frying pan and slowly add 2 cups of beef broth.", "Sprinkle a dash of extra marjoram into gravy and stir.", "Pour gravy over steak rolls in casserole dish.", "Either bake now at 350°F for 1-1-1/2 hours or you can refrigerate and cook later."
)

c("Steak  --  Mix all the ingredients in a large baggie and add the steak.  Shake to mix well and then let it marinade. 3-4 hours is great, but 30 minutes will even work and give you some good flavor.  The longer the better.", "Salsa  --  In a small sauce pan over medium heat, add the black beans, pineapple, pepper, red onion and cook 4-5 minutes.  Then add the orange marmalade and rice wine vinegar cook another minute or two and remove from the heat. Add to a small bowl and cover and refrigerate until ready to use.  I like to serve it chilled, but you can also serve this warm right off the stove or even room temperature.", 
"Grill  --  Now I like to use a grill pan or outdoor grill for this, but a broiler or large saute pan will work fine.  If using a large saute pan, just cut the skirt steak into large pieces.  The skirt steak doesn't take long. Just spray with some olive oil or Pam and season the steak with salt and pepper on each side.  Grill until medium rare, for skirt steak. I do 125 and after it rests it will be right around 130 which is a perfect medium rare. It only takes 5 minutes or so per side.", "Serve  --  I like to serve over some yellow rice, but you can use anything thing you like.  Slice the steak (always on a angle against the grain) and then top with the fresh pineapple salsa.  Garnish with the scallions and cilantro.  Add with some great toasted bread or a small salad and you have a great dinner in no time."
)

c("For potatoes: In saucepan, cover diced potatoes with water, bring to a boil, boil til tender. (15-20 minutes.) Drain, place into food processor, add rest of potato ingredients except bacon and pulse/process til just smooth but thick. Fold in bacon. Cover and set aside.", "For Shallot Onion Rings: Heat oven to 375. Toss shallot rings in melted butter, then breadcrumbs mixed with parmesan cheese and place onto parchment paper-lined baking sheet. Sprinkle with any excess breadcrumb mixture and bake til golden. 15-20 minutes. (*You can do this while the potatoes are boiling. **You can also bake the bacon as well for the same amount of time and temp if you don't have any already cooked on hand.) Remove from oven and set aside to cool.", 
"For the Steak:", "Rub dip mix evenly on both sides of steak. Brush each side with melted butter and grill over high heat for 5 minutes per side for rare/med- rare. (Or pan fry in hot pan over high heat.) Remove and let rest for 5 minutes. Then thinly slice against the grain into small strips. (While steak is resting, you can rewarm the potatoes if needed in the microwave.).", "To Assemble:", "Place 16 crackers onto serving platter (*or baking sheet.) Top each with spoonfuls of warm mashed potatoes, loosely rolled spinach leaves, slices of steak, shallot onion rings, and blue cheese crumbles. Sprinkle with a little fresh cracked black pepper and sea salt. Serve with sriracha sauce for a little heat! (*You can also run these under the broiler if desired, but watch them carefully! Remove when blue cheese just starts to melt and bubble!) No need to call your friends that they are ready, they'll already be gathering in the kitchen like little vultures! Enjoy! CHEERS! :)."
)
